mapper.select:
SELECT *
FROM "DbWT0002KokuhorenTorikomiError" as TEMP
where TEMP.errorKubun = #{errorKubunCode}
and TEMP.shoHokanehshaNo = #{shoHokanehshaNo}
and TEMP.hihokenshaNo = #{hihokenshaNo}
and TEMP.key1 = #{key1}
and TEMP.key2 = #{key2}
and TEMP.key3 = #{key3}
and TEMP.key4 = #{key4}
and TEMP.key5 = #{key5}

mapper.update:
UPDATE "DbWT0001Hihokensha"
set
"oldShichosonCode" = #{旧市町村コード}
where
"shoHokenshaNo" = #{証記載保険者番号}

UPDATE "DbWT0001Hihokensha"
set
"henkanHihokenshaNo" = #{新番号},
"hihokenshaNo" = #{新番号}
where
"meisaiRenban" = #{連番}
